    [],nt"revision_timestamp": "2016-05-25T00:52:46.500830",nt"name": "instrument-flight-procedures-automation",nt"isopen":
    true,nt"url": null,nt"notes": "Instrument Flight Procedures Automation
    (IFPA) is an automation system used to create new Instrument Flight Procedures (IFPs)
    and to maintain existing IFPs.IFPs provide pilots with approach paths clear of obstacles
    such as cell towers, buildings and trees into and out of an airport.  Procedures
    define the operational rules for executing defined maneuvers.  Procedure information
    includes approaches, holding, departures, arrivals, routes and minimum altitudes.
     Procedures are developed to dictate the execution of certain National Airspace
    System (NAS) operations under specified conditions or avionics equipage use in the
    cockpit.  Effective procedures management requires periodic procedure reviews due
    to the impact of obstacles.  Short-term notices to pilots called Notices-to-Airmen
    (NOTAMs) are also developed and issued.IFPA is comprised of four key components,
    each with functional sub-components called modules, some of which are operational
    already.",nt"license_title": "Other License Specified",nt"extras": [{ntt"key":
